import React from 'react';
import './Button.css';
import { Link } from 'react-router-dom';
{/* ovde smo pravili "univerzalno" dugme sve sto je ovde se odnosi na sva dugmat u celom projektu
    STYLES smo stavili da moze da nam bude dve vrste isto tako i za SIZES*/}
const STYLES = ['btn--primary', 'btn--outline'];

const SIZES = ['btn--medium', 'btn--large'];
{/* Ovde smo definisali "atribute" za dugme*/}
export const Button = ({children, type, onClick, buttonStyle, buttonSize}) => {
    {/* Stavili smo da ako je dugmetu dodeljen stil onda ce da bude taj stil a ako nije definisano onda ce piti prvi u nizu STYLES koje smo definisali*/}
   const chechButtonStyle = STYLES.includes(buttonStyle) ? buttonStyle : STYLES[0];
    {/* Stavili smo da ako je dugmetu dodeljena velicina bice ta a ako nije onda ce biti prva u nizu SIZES koje smo prethodno definisali*/}
   const chechButtonSize = SIZES.includes(buttonSize) ? buttonSize : SIZES[0];

   return (
       <Link to ='/sign-up ' className='btn--mobile'>
           {/* Ovde smo stavili sta nam sve duge ima, drugim recima definisali smo dugme*/}
           {/* Ovde smo stavili proveru ${} da vidi postoji li stil i velicina i sta da mu stavi*/}
           <button
            className={`btn ${chechButtonStyle} ${chechButtonSize}`}
            onClick={onClick}
            type={type}
           >
               {children}
           </button>
       </Link>
   )

};
